import React from 'react';

export default function Header() {
    return (

            <nav id="navigation">
                <div id="logo">
                    <img src="./detective-logo.png" id="logo-picture" />
                    <p>LOGO</p>
                </div>

                <ul>
                    <li>Article</li>
                    <li>Video</li>
                    <li>Q&A</li>
                </ul>
                <ul>
                    <li>Sign in</li>
                    <li id="signup">
                        Sign Up
                    </li>
                </ul>
            </nav>
    )
}

function Signup() {
    return (<h2>Signup page</h2>);
}
